import './App.css';
import React from 'react';
import Axios from 'axios';

function App() {
  Axios({
    method: 'GET',
    url: "http://localhost:3000/",
    headers: {
      "Content-Type": "application/json"
    }
  }).then(response => console.log(response.data.message));

  return (
    <div className="App">
       <h1>Moment One</h1>
      </div>
  )}


export default App;
